import React, {Fragment, useState, useEffect} from 'react';
import Navigation from './Navigation';
import axios from 'axios';



const Programmation = () => {

    const [data, setData] = useState()

    useEffect(() => {

        const fetchData = async () => {
        const result = await axios(
        "/memory_admin/controller/programme/programme_api.php",
        );
                
        setData(result.data);
        console.log("updated");
        };
        fetchData();
        console.log("mounted");
        

    }, [])

    return(
        <Fragment>
            <Navigation />


            {data.filter(musique => musique.type_rap === data).map((item, key) => ( // enlever le filter
                <li className="informations_generales" key={key}>
                    <ul>
                        <div className="sous_titre_et_contenu_information_faq">
                            <li>
                                <div>{ item.type_rap}</div>
                            </li>
                        </div>
                    </ul>
                </li> 
            ))}
        </Fragment>
    )
}

export default Programmation
